Console Timer Service
[TestClass]
    public class TimerTests
    {
        int value = 1;
        [TestMethod]
        public void CallBackTimerTest()
        {
            //arrange
            CallbackTimer timer = new CallbackTimer(100, CallbackMethod);
            //act
            timer.Start();
            Thread.Sleep(150);
            timer.Dispose();
            //assert
            Assert.AreEqual(value, 2);
        }
        public void CallbackMethod(object objectValue)
        {
            value = value + 1;
        }
    }

